eftClick\n--功能：拖动元素到指定坐标 \n   元素：需要操作的元素\n   操作数据：DragElement;;56;;78\n',NULL,NULL,'admin','2020-02-17 14:09:09','admin','2020-02-17 14:09:09'),(63,10,'getSpecialString','获取随机数','描述：将随机数存入变量\n可选值：\n--功能：根据正则生成随机数存入变量\n   元素：无\n   操作数据：reg;;正则表达式;;变量名\n--功能：生成md5存入变量\n   元素：无\n   操作数据：md5;;需要加密的字符串;;变量名',NULL,NULL,'admin','2020-03-04 12:29:31','admin','2020-03-04 12:29:31'),(64,2,'Chrome_v71-73','Chrome_v71-73','',NULL,NULL,'admin','2020-03-05 10:29:42','admin','2020-03-06 09:07:35'),(65,2,'Chrome_customer','Chrome_customer','Chrome自动义驱动，如果驱动未及时更新，可以手动将下\n载好的驱动替换到client端的\nlibs/webDiver/chromedriver_customer目录下',NULL,NULL,'admin','2020-03-06 09:07:13','admin','2020-03-06 09:37:50');

/*Table structure for table `sys_permission` */

DROP TABLE IF EXISTS `sys_permission`;

CREATE TABLE `sys_permission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parentId` int(11) NOT NULL COMMENT '父ID',
  `name` varchar(50) NOT NULL COMMENT '名称',
  `icon` varchar(30) DEFAULT NULL COMMENT '图标',
  `path` varchar(1000) DEFAULT NULL COMMENT '路由',
  `redirect` varchar(1000) DEFAULT NULL COMMENT '重定向路径',
  `active_menu` varchar(1000) DEFAULT NULL COMMENT '菜单栏高亮路径，默认为本路径',
  `type` tinyint(1) NOT NULL COMMENT '类型1 菜单 2：按钮 3：子页面',
  `permission` varchar(50) DEFAULT NULL COMMENT '权限标识',
  `sort` int(11) NOT NULL COMMENT '排序',
  `component` varchar(1000) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_parentId` (`parentId`)
) ENGINE=InnoDB AUTO_INCREMENT=124 DEFAULT CHARSET=utf8mb4;

