  PRIMARY KEY (`id`) USING BTREE,
  KEY `type` (`type`),
  KEY `project_id` (`project_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COMMENT='分类表';

